		"lang": "ko",
		"text": "이번엔 술과 노가리가 아닌 음악과 책으로 마음의 굶주림을 채워보는 시간!\n솔로 첫 지방공연을 기념하여 정목님이 발표한 모든곡을 연주합니다.\n그 외에도 다양하고 풍성한 공연을 준비 하고 있으니 많은 관심 부탁드려요! https://t.co/jGAN6x5qeM"
